  summary: "\nThis class provides a thread-per-operation execution model, where (in principle) a new\nthread is spawned and immediately starts executing for each asynchronous operation. The\nnumber of threads is limited by configuration information, and callers will block once\nthe limit is reached.\n"
  syntax:
